import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route} from "react-router-dom";
import Home from '../Components/home';
import Login from '../Components/login';
import Product from '../Components/product/product';
import ProductPage from '../Components/product/productPage';
import Products from '../Components/product/products';
class App extends React.Component {
  constructor(props){  
    super(props);  
    this.state = {  
      isUserAthanticated: true
    }
  }
  render(){
    return (
      <Router>
        <Routes>
          <Route exact path="/" element={<Home isUserAthanticated={this.state.isUserAthanticated}/>} />
          <Route exact path="/shop" element={<Home isUserAthanticated={this.state.isUserAthanticated}/>} />
          <Route exact path="/product" element={<ProductPage isUserAthanticated={this.state.isUserAthanticated}/>}>
            <Route path="" element={<Products isUserAthanticated={this.state.isUserAthanticated}/>} />
            <Route path=":postSlug" element={<Product isUserAthanticated={this.state.isUserAthanticated}/>} />
          </Route>
          <Route exact path="/pages" element={<Home isUserAthanticated={this.state.isUserAthanticated}/>} />
          <Route exact path="/blog" element={<Home isUserAthanticated={this.state.isUserAthanticated}/>} />
          <Route exact path="/elements" element={<Home isUserAthanticated={this.state.isUserAthanticated}/>} />
          <Route path="/login" element={ <Login isUserAthanticated={this.state.isUserAthanticated}/>} />
          {/* <Navigate to="/" element={<Home />} /> */}
        </Routes>
      </Router>
    );
  }
}

export default App;
